// Placeholder pages for routes
import React from 'react';

export const Profile = () => (
  <div>
    <h1 className="text-2xl font-bold mb-4">Profile</h1>
    <p>Profile page coming soon...</p>
  </div>
);

export const Expenses = () => (
  <div>
    <h1 className="text-2xl font-bold mb-4">Expenses</h1>
    <p>Expenses page coming soon...</p>
  </div>
);

export const ExpenseForm = () => (
  <div>
    <h1 className="text-2xl font-bold mb-4">Expense Form</h1>
    <p>Expense form coming soon...</p>
  </div>
);

export const ExpenseDetail = () => (
  <div>
    <h1 className="text-2xl font-bold mb-4">Expense Detail</h1>
    <p>Expense detail page coming soon...</p>
  </div>
);

export const Approvals = () => (
  <div>
    <h1 className="text-2xl font-bold mb-4">Approvals</h1>
    <p>Approvals page coming soon...</p>
  </div>
);

export const Users = () => (
  <div>
    <h1 className="text-2xl font-bold mb-4">User Management</h1>
    <p>User management page coming soon...</p>
  </div>
);

export const Company = () => (
  <div>
    <h1 className="text-2xl font-bold mb-4">Company Settings</h1>
    <p>Company settings page coming soon...</p>
  </div>
);

export const Workflows = () => (
  <div>
    <h1 className="text-2xl font-bold mb-4">Approval Workflows</h1>
    <p>Workflows page coming soon...</p>
  </div>
);

export const Analytics = () => (
  <div>
    <h1 className="text-2xl font-bold mb-4">Analytics</h1>
    <p>Analytics page coming soon...</p>
  </div>
);
